import { existsSync, readFileSync } from 'fs';
import { join, resolve } from 'path';

const assetPathResolvers = [
  (filename: string) => join(__dirname, 'assets', filename),
  (filename: string) => resolve(__dirname, '..', '..', 'src', 'templates', 'assets', filename),
  (filename: string) =>
    join(process.cwd(), 'apps', 'backend', 'src', 'templates', 'assets', filename),
  (filename: string) =>
    join(process.cwd(), 'apps', 'backend', 'dist', 'templates', 'assets', filename),
];

function loadAssetAsDataUrl(
  filename: string,
  mimeType: string,
  fallbackBase64?: string,
): string {
  for (const resolver of assetPathResolvers) {
    const assetPath = resolver(filename);
    if (existsSync(assetPath)) {
      const base64 = readFileSync(assetPath).toString('base64');
      return `data:${mimeType};base64,${base64}`;
    }
  }

  if (fallbackBase64) {
    return `data:${mimeType};base64,${fallbackBase64}`;
  }

  throw new Error(`Asset '${filename}' não encontrado nas pastas esperadas.`);
}

