@Injectable()
export class TemplatesService {
  public async getPopulatedCertificateHtml(
    data: CertificateData,
    templateId: string = 'default',
  ): Promise<string> {
    const template = allTemplates[templateId];

    if (!template) {
      throw new NotFoundException(
        `Template com ID '${templateId}' não foi encontrado no código.`,
      );
    }

    const certificateCode = data.certificateId ?? '';
    const envBaseUrl = process.env.FRONTEND_URL ?? '';
    const trimmedEnvBase = envBaseUrl.trim();

    let normalizedBaseUrl: string;

    if (trimmedEnvBase.length > 0) {
      try {
        const parsed = new URL(trimmedEnvBase);

        if (parsed.hostname === 'localhost') {
          parsed.port = parsed.port && parsed.port !== '' ? parsed.port : '3000';
          if (parsed.port === '3000') {
            parsed.port = '3001';
          }
          normalizedBaseUrl = parsed.origin;
        } else {
          normalizedBaseUrl = parsed.origin;
        }
      } catch {
        normalizedBaseUrl = trimmedEnvBase;
      }
    } else {
      normalizedBaseUrl = 'http://localhost:3001';
    }

    normalizedBaseUrl = normalizedBaseUrl.replace(/\/+$/, '');

    // Lógica de Geração do QR Code
    const validationUrl = `${normalizedBaseUrl}/validar/${certificateCode}`;
    const qrCodeDataUrl = await QRCode.toDataURL(validationUrl);

    const { html, css } = template;

    const signatureJpeg = sharedAssets.signatureImage;

    // Garantir que o horário exibido esteja no fuso de Brasília (America/Sao_Paulo)
    const formattedIssueDateTime = this.formatToSaoPaulo(
      data.issueDateTime ?? '',
    );

    const populatedHtml = html
      .replace(/{{doctorName}}/g, data.doctorName ?? '')
      .replace(/{{doctorSpecialty}}/g, data.doctorSpecialty ?? 'Clínico Geral')
      .replace(/{{doctorCRM}}/g, data.doctorCrm ?? '')
      .replace(
        /{{doctorAddress}}/g,
        data.doctorAddress ?? 'Endereço não informado',
      )
      .replace(/{{doctorPhone}}/g, data.doctorPhone ?? 'Contato não informado')
      .replace(/{{patientName}}/g, data.patientName ?? '')
      .replace(/{{patientCPF}}/g, data.patientCpf ?? '')
      .replace(/{{patientAge}}/g, data.patientAge ?? '')
      .replace(/{{patientSex}}/g, data.patientSex ?? 'Não informado')
      .replace(/{{durationInDays}}/g, data.durationInDays.toString())
      .replace(/{{durationInWords}}/g, data.durationInWords ?? '')
      .replace(/{{startDate}}/g, data.startDate ?? '')
      .replace(/{{purpose}}/g, data.purpose ?? '')
      .replace(/{{cidCode}}/g, data.cidCode ?? 'Não informado')
      .replace(/{{cidDescription}}/g, data.cidDescription ?? '')
      .replace(/{{issueDateTime}}/g, formattedIssueDateTime)
      .replace(/{{certificateId}}/g, data.certificateId ?? '')
      .replace('{{validationUrl}}', validationUrl)
      .replace('{{signatureImage}}', signatureJpeg)
      .replace('{{qrCodeDataUrl}}', qrCodeDataUrl)
      .replace('{{cfmHeaderImage}}', sharedAssets.cfmHeaderImage)
      .replace('{{medicineIcon}}', sharedAssets.medicineIcon);

    return populatedHtml.replace('</head>', `<style>${css}</style></head>`);
  }

  public async getPopulatedPrescriptionHtml(
    data: PrescriptionData,
    templateId: string = 'default',
  ): Promise<string> {
    const template = prescriptionTemplates[templateId];

    if (!template) {
      throw new NotFoundException(
        `Template com ID '${templateId}' não foi encontrado no código.`,
      );
    }

    const prescriptionCode = data.prescriptionCode ?? '';
    const envBaseUrl = process.env.FRONTEND_URL ?? '';
    const trimmedEnvBase = envBaseUrl.trim();

    let normalizedBaseUrl: string;

    if (trimmedEnvBase.length > 0) {
      try {
        const parsed = new URL(trimmedEnvBase);

        if (parsed.hostname === 'localhost') {
          parsed.port = parsed.port && parsed.port !== '' ? parsed.port : '3000';
          if (parsed.port === '3000') {
            parsed.port = '3001';
          }
          normalizedBaseUrl = parsed.origin;
        } else {
          normalizedBaseUrl = parsed.origin;
        }
      } catch {
        normalizedBaseUrl = trimmedEnvBase;
      }
    } else {
      normalizedBaseUrl = 'http://localhost:3001';
    }

    normalizedBaseUrl = normalizedBaseUrl.replace(/\/+$/, '');
    const validationUrl = `${normalizedBaseUrl}/receitas/validar/${prescriptionCode}`;
    const qrCodeDataUrl = await QRCode.toDataURL(validationUrl);

    const signatureJpeg = sharedAssets.signatureImage;
    const cfmHeaderImage = sharedAssets.cfmHeaderImage;
    const items = data.items ?? [];
    const itemsHtml =
      items.length > 0
        ? items
            .map((item) => {
              const parts: string[] = [];
              parts.push('<li>');
              parts.push(`<span class="item-title">${item.title}</span>`);
              const description = this.formatMultilineText(item.description);
              if (description) {
                parts.push(`<p class="item-description">${description}</p>`);
              }
              const observation = this.formatMultilineText(item.observation);
              if (observation) {
                parts.push(`<p class="item-observation">${observation}</p>`);
              }
              parts.push('</li>');
              return parts.join('');
            })
            .join('')
        : '<li><span class="item-title">Receita não informada</span></li>';

    const specialtyLabel =
      data.doctorSpecialty && data.doctorSpecialty.trim().length > 0
        ? ` - ${data.doctorSpecialty.trim()}`
        : '';

    const rawPatientAge = `${data.patientAge ?? ''}`.trim();
    const patientAgeText =
      rawPatientAge.length === 0
        ? 'Não informado'
        : /^\d+$/.test(rawPatientAge)
        ? `${rawPatientAge} anos`
        : rawPatientAge;

    const rawPatientSex = `${data.patientSex ?? ''}`.trim();
    const patientSexText =
      rawPatientSex.length > 0 ? rawPatientSex : 'Não informado';

    const generalGuidance = this.formatMultilineText(
      data.generalGuidance,
      'Orientações não informadas.',
    );

    const additionalNotes = this.formatMultilineText(
      data.additionalNotes,
      'Se persistirem os sintomas, procurar um Pronto Atendimento.',
    );

    const formattedIssueDateTime = this.formatToSaoPaulo(
      data.issueDateTime ?? '',
    );

    const populatedHtml = template.html
      .replace(/{{doctorName}}/g, data.doctorName ?? '')
      .replace(/{{doctorCrm}}/g, data.doctorCrm ?? '')
      .replace(/{{doctorSpecialtyLabel}}/g, specialtyLabel)
      .replace(/{{patientName}}/g, data.patientName ?? '')
      .replace(/{{patientCpf}}/g, data.patientCpf ?? '')
      .replace(/{{patientAge}}/g, patientAgeText)
      .replace(/{{patientSex}}/g, patientSexText)
      .replace(/{{issueDateTime}}/g, formattedIssueDateTime)
      .replace('{{itemsList}}', itemsHtml)
      .replace('{{generalGuidance}}', generalGuidance)
      .replace('{{additionalNotes}}', additionalNotes)
      .replace(/{{prescriptionCode}}/g, prescriptionCode)
      .replace('{{validationUrl}}', validationUrl)
      .replace('{{signatureImage}}', signatureJpeg)
      .replace('{{qrCodeDataUrl}}', qrCodeDataUrl)
      .replace('{{cfmHeaderImage}}', cfmHeaderImage);

    return populatedHtml.replace(
      '</head>',
      `<style>${template.css}</style></head>`,
    );
  }

  private formatMultilineText(
    value?: string | null,
    fallback: string = '',
  ): string {
    if (!value || value.trim().length === 0) {
      return fallback;
    }

    return value
      .split(/\r?\n/)
      .map((line) => line.trim())
      .filter((line) => line.length > 0)
      .join('<br />');
  }

  /**
   * Formata uma data/hora para o fuso de Brasília (America/Sao_Paulo) em formato
   * legível: dd/MM/yyyy - HH:mm:ss (GMT-03).
   * Aceita strings ISO ou objetos Date. Se a entrada for inválida, retorna string vazia.
   */
  private formatToSaoPaulo(value?: string | Date | null): string {
    // Se não foi fornecido, usa o momento atual
    let date: Date;

    if (!value) {
      date = new Date();
    } else if (value instanceof Date) {
      date = value;
    } else if (typeof value === 'string') {
      // Tenta parse padrão (ISO)
      const parsed = new Date(value);
      if (!Number.isNaN(parsed.getTime())) {
        date = parsed;
      } else if (/^\d+$/.test(value.trim())) {
        // Epoch em ms
        const num = Number(value.trim());
        const fromNum = new Date(num);
        if (!Number.isNaN(fromNum.getTime())) {
          date = fromNum;
        } else {
          // Se não consegue parsear, assume que a string já está em formato legível e retorna como está
          return value;
        }
      } else {
        const legacyMatch = value
          .trim()
          .match(
            /^(\d{1,2})\s+de\s+([a-zçãéêíóúà]+)\s+de\s+(\d{4})\s*(?:às|as)\s*(\d{2}):(\d{2})(?::(\d{2}))?$/i,
          );

        if (legacyMatch) {
          const [, dayStr, monthName, yearStr, hourStr, minuteStr, secondStr] =
            legacyMatch;

          const normalizedMonth = monthName
            .normalize('NFD')
            .replace(/[\u0300-\u036f]/g, '')
            .toLowerCase();

          const monthMap: Record<string, number> = {
            janeiro: 0,
            fevereiro: 1,
            marco: 2,
            abril: 3,
            maio: 4,
            junho: 5,
            julho: 6,
            agosto: 7,
            setembro: 8,
            outubro: 9,
            novembro: 10,
            dezembro: 11,
          };

          const monthIndex = monthMap[normalizedMonth as keyof typeof monthMap];

          if (monthIndex !== undefined) {
            const year = Number.parseInt(yearStr, 10);
            const day = Number.parseInt(dayStr, 10);
            const hour = Number.parseInt(hourStr, 10);
            const minute = Number.parseInt(minuteStr, 10);
            const second = secondStr
              ? Number.parseInt(secondStr, 10)
              : 0;

            const isoString = `${year.toString().padStart(4, '0')}-${(monthIndex + 1)
              .toString()
              .padStart(2, '0')}-${day
              .toString()
              .padStart(2, '0')}T${hour
              .toString()
              .padStart(2, '0')}:${minute
              .toString()
              .padStart(2, '0')}:${second
              .toString()
              .padStart(2, '0')}-03:00`;

            const legacyDate = new Date(isoString);
            if (!Number.isNaN(legacyDate.getTime())) {
              return this.formatToSaoPaulo(legacyDate);
            }
          }
        }

        // Se não consegue parsear, assume que a string já está em formato legível e retorna como está
        return value;
      }
    } else {
      return '';
    }

    try {
      const options: Intl.DateTimeFormatOptions = {
        timeZone: 'America/Sao_Paulo',
        year: 'numeric',
        month: '2-digit',
        day: '2-digit',
        hour: '2-digit',
        minute: '2-digit',
        second: '2-digit',
        hour12: false,
      };

      const parts = new Intl.DateTimeFormat('pt-BR', options).formatToParts(
        date,
      );
      const get = (type: string) =>
        parts.find((p) => p.type === type)?.value ?? '';
      const day = get('day');
      const month = get('month');
      const year = get('year');
      const hour = get('hour');
      const minute = get('minute');
      const second = get('second');
      return `${day}/${month}/${year} - ${hour}:${minute}:${second} (GMT-03)`;
    } catch (err) {
      return '';
    }
  }
}
